import React from 'react';

const App = () =>{
    return (
        <>
            <div className="main_div">
                <div className="center_div">
                    <br/>
                    <h1>ToDo List</h1>
                </div>
            </div>
            <h1>Hello world </h1>
        </>
    )

}

export default App;
